script: |
  super -f text -I q10338.spq | sort > q10338.out

inputs:
  - name: q10338.spq
    data: |
      SELECT 91 AS col0 FROM tab2 (FORMAT parquet) cor0 WHERE ( - + col0 NOT BETWEEN col0 + - col0 + - col2 AND NULL );
  - name: tab2

outputs:
  - name: q10338.out
    data: |
      91
      91
      91
